li.list-item.selected:focus::before {
  background: #1d1f21;
}
li.list-item.selected:focus span,
li.list-item.selected:focus .syntax--entity.syntax--entity,
li.list-item.selected:focus .icon {
  color: #ffffff;
}
.list-nested-item.selected:focus::before {
  background: #1d1f21;
}
.list-nested-item.selected:focus > .list-item span,
.list-nested-item.selected:focus > .list-item .syntax--entity.syntax--entity,
.list-nested-item.selected:focus > .list-item .icon {
  color: #ffffff;
}
